import * as React from "react";
import { styled } from "@mui/material/styles";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";
import { Container } from "@mui/material";
import GenericInputField from "./TextField";

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

export default function RowAndColumnSpacing() {
  return (
    <>
      <Container sx={{ backgroundColor: "red", width: "100%" }}>
        <Box sx={{ backgroundColor: "yellow", width: "50%" }}></Box>
      </Container>
      <Box sx={{ width: "100%" }}>
        <Grid
          container
          direction="column"
          spacing={2}
          // rowSpacing={1}
          // columnSpacing={{ xs: 1, sm: 2, md: 3 }}
        >
          <Box sx={{ width: "50%" }}>
            <Grid item xs={12}>
              <GenericInputField
                label="Email"
                helperText="Email"
                errorStatus={false}
              />
            </Grid>
            <Grid item xs={12}>
              <GenericInputField
                label="Email"
                helperText="Email"
                errorStatus={false}
              />
            </Grid>
            <Grid item xs={12}>
              <GenericInputField
                label="Email"
                helperText="Email"
                errorStatus={false}
              />
            </Grid>
            <Grid item xs={12}>
              <GenericInputField
                label="Email"
                helperText="Email"
                errorStatus={false}
              />
            </Grid>
          </Box>
        </Grid>
      </Box>
    </>
  );
}
